import React, { Component } from "react";
import "./Appointments.css";

export class Appointments extends Component {
  render() {
    const { physician, appointments } = this.props;
    const currAppointments = appointments.filter(
      appointment => appointment.physician === physician.id
    );
    return (
      <div className="Appointments">
        {physician.id ? (
          <div>
            <div>
              Dr. {physician.firstName} {physician.lastName}
            </div>
            <div>{physician.email}</div>
            {currAppointments && (
              <ul>
                {currAppointments.map((curr, i) => (
                  <li key={i + 1}>
                    {curr.patient} {curr.time} {curr.kind}
                  </li>
                ))}
              </ul>
            )}
          </div>
        ) : (
          <div>Please Select a Physician</div>
        )}
      </div>
    );
  }
}

export default Appointments;
